		jsr 	PlayTrack
		jsr 	originalPlayInGameSound
		rts
CustomPlaySound_22
		move.l 	#22,d0
		ori.w 	#$1100,d0					; set MCD_CMD to d0
		jsr 	PlayTrack
		jsr 	originalPlayInGameSound
		rts
CustomPlaySound_ST
		addi.w  #$01,d0
		ori.w 	#$1100,d0					; set MCD_CMD to d0
		jsr 	PlayTrack
		jsr 	originalPlayInGameSound
		rts		
CustomPlaySound_SEGA
		tst.b 	MCD_STAT
		bne.s 	CustomPlaySound_SEGA 
		move.w 	#($1100|27),MCD_CMD 		; send cmd: play track #27
		addq.b	#1,MCD_CMD_CK				; Increment command clock
		jsr   	$CE6 						; original code that was bypassed
		move.w  #$100,($A11100).l 			; original code that was bypassed
		rts



PlayTrack ; SubRoutine for playing tracks and mute chipsound:
		tst.b 	MCD_STAT
		bne.s 	PlayTrack 					; Wait for Driver ready to receive cmd
		move.w	d0,MCD_CMD					; send cmd: play track #no/loop in D0
		addq.b	#1,MCD_CMD_CK				; Increment command clock
		move 	#$000000FF,d0				; Stops the chipsound
		rts



pause_on
		jsr 	play_pause_sfx
		move.w 	#($1300|20),MCD_CMD 		; send cmd: pause track, fade 20/70 seconds
		addq.b 	#1,MCD_CMD_CK 				; Increment command clock
		rts

pause_off
		move.w 	#($1400|0),MCD_CMD 			; send cmd: resume track
		addq.b 	#1,MCD_CMD_CK 				; Increment command clock
		move.w  #0,($FFF63A).w				; original code that was bypassed (set pause flag false)
		rts

play_pause_sfx								; I wanted to add a pause indicator jingle as in SuperGNG,
		move.w  #$100,($A11100).l			; but as it turns out, in pause mode no sound will play.
		btst 	#0,($A11100).l				; Instead it's played on exiting pause-mode, which is ok,
		bne.s   play_pause_sfx				; until somebody is willing to mess with the interrupt
		move.b  #$AE,($A01C04).l 			; that prevents the sound from playing at the correct 
		move.w  #0,($A11100).l 				; moment. @TODO
		rts

musicBoss3fix
		cmp.b	#$92,d0
		beq		play_boss3_track
		move.b  d0,($A01C06).l
		rts 
play_boss3_track
		move.b  $FF,($A01C06).l
		move.w 	#($1200|11),MCD_CMD					; set MCD_CMD: play track #11, loop
		addq.b 	#1,MCD_CMD_CK 
		rts
		
; MSU-MD INIT: -------------------------------------------------------------------------------------

		align 	2
audio_init
		jsr 	MSUDRV
		nop
		;tst.b 	d0							; if 0: no CD Hardware found
		;bne		audio_init_fail				; Return without setting CD enabled
ready_init
		tst.b 	MCD_STAT
		bne.s 	ready_init
		move.w 	#($1500|255),MCD_CMD		; Set CD Volume to MAX
		addq.b 	#1,MCD_CMD_CK 				; Increment command clock
		rts
audio_init_fail
		jmp 	lockout



; ENTRY POINT: -------------------------------------------------------------------------------------

		align 	2
ENTRY_POINT
		tst.w 	$00A10008  					; Test mystery reset (expansion port reset?)
		bne Main          					; Branch if Not Equal (to zero) - to Main
		tst.w 	$00A1000C  					; Test reset button
		bne Main          					; Branch if Not Equal (to zero) - to Main
Main
		move.b 	$00A10001,d0      			; Move Megadrive hardware version to d0
		andi.b 	#$0F,d0           			; The version is stored in last four bits, so mask it with 0F
		beq 	Skip                  		; If version is equal to 0, skip TMSS signature
		move.l 	#'SEGA',$00A14000 			; Move the string "SEGA" to 0xA14000
Skip
		btst 	#$6,(HW_version).l 			; Check for PAL or NTSC, 0=60Hz, 1=50Hz
		bne 	jump_lockout				; branch if != 0
		jsr 	audio_init
		jmp 	Game
jump_lockout
		jmp 	lockout
		


